import React from 'react';

const PageTitleJournalSingle = () => {
    return (
        <section id="page-title">
            <div className="wrapper">
                <div className="title position-relative">
                    <h1 className="small">What to do <br/>when <span className="line">holidays</span> go wrong</h1>

                    <div className="title-clone">Journal.</div>
                </div>
            </div>
        </section>
    );
};

export default PageTitleJournalSingle;
